--
-- Name: inventory_view; Type: VIEW; Schema: public; Owner: eltafawook_db_user
--

CREATE VIEW public.inventory_view AS
 WITH onhand AS (
         SELECT stock_ledger.branch_id,
            stock_ledger.item_id,
            COALESCE(sum(stock_ledger.qty), (0)::bigint) AS on_hand
           FROM public.stock_ledger
          GROUP BY stock_ledger.branch_id, stock_ledger.item_id
        ), reserved AS (
         SELECT reservations.branch_id,
            reservations.item_id,
            COALESCE(sum(reservations.qty), (0)::bigint) AS reserved
           FROM public.reservations
          WHERE (reservations.status = ANY (ARRAY['hold'::public.reservation_status, 'active'::public.reservation_status]))
          GROUP BY reservations.branch_id, reservations.item_id
        )
 SELECT COALESCE(o.branch_id, r.branch_id) AS branch_id,
    COALESCE(o.item_id, r.item_id) AS item_id,
    COALESCE(o.on_hand, (0)::bigint) AS on_hand,
    COALESCE(r.reserved, (0)::bigint) AS reserved,
    (COALESCE(o.on_hand, (0)::bigint) - COALESCE(r.reserved, (0)::bigint)) AS available
   FROM (onhand o
     FULL JOIN reserved r ON (((r.branch_id = o.branch_id) AND (r.item_id = o.item_id))));


